import React, {Component} from 'react';
import {Table} from 'react-bootstrap';
class Body extends Component{
	render(props){
		const results=this.props.data;
		console.log(results);
		return(
			<div>
				<ul>
					 {results.map(item => <li key={item.id}>{item.title} - {item.description} - {item.date_posted}</li>)}
				</ul>
			</div>
		)
	}
};

export default Body;
